import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="container">
          <div className="row">
            <div className="col-2"></div>
            <div className="col-8">

              <Button
                text="Get Cat"
                type="button"
                className="btn btn-light"
              />
            </div>
            <div className="col-2"></div>
          </div>
        </div>
      </div>
    );
  }
}


const Button = ({ text ,...props}) => {
  return <button {...props}>{text}</button>
}


export default App;
